{"operationName":"Streams","variables":{"sender":""},"query":"query Streams($sender: String!) {
  streams(
    first: 500
    orderBy: timestamp
    orderDirection: desc
    where: {sender: $sender}
  ) {
    ...Stream
    __typename
  }
}

fragment Stream on Stream {
  id
  cancellation {
    ...Cancellation
    __typename
  }
  deposit
  ratePerSecond
  recipient
  sender
  startTime
  stopTime
  timestamp
  token {
    ...Token
    __typename
  }
  ...Txs
  ...Withdrawals
  ...LocalStream
  __typename
}

fragment Cancellation on Cancellation {
  id
  recipientBalance
  senderBalance
  timestamp
  token {
    address: id
    decimals
    __typename
  }
  txhash
  __typename
}

fragment Txs on Stream {
  txs(where: {event: "CreateStream"}) {
    ...StreamTransaction
    __typename
  }
  __typename
}

fragment StreamTransaction on StreamTransaction {
  id
  block
  event
  timestamp
  txhash
  __typename
}

fragment Withdrawals on Stream {
  withdrawals(first: 1000, orderBy: timestamp, orderDirection: desc) {
    ...Withdrawal
    __typename
  }
  __typename
}

fragment Withdrawal on Withdrawal {
  id
  amount
  timestamp
  token {
    address: id
    decimals
    __typename
  }
  txhash
  __typename
}

fragment LocalStream on Stream {
  cancellation {
    __typename
  }
  __typename
}

fragment Token on Token {
  address: id
  decimals
  name
  symbol
  __typename
}"}

